Gabriella Paltrova is on her way to her college's Winter Formal Dance. Her limo driver, Billy, lends his ear and discovers that Gabriella wants nothing to do with her date but she nevertheless takes him along. Jimmy, the date, is a phenomenal douchebag and tries to get fresh with Gabriella almost immediately. When Billy can stand it no more, he kicks Jimmy out, leaving Gabriella dateless.
